// this is your custom vertex transform function.
// you can modify the incoming vertex data here as want.
void CustomVertexTransform(inout VertexData vs) {

   // your code here
    float t = sin(kTime*2.0) * .5 + .5;

    vec2 xy = vs.vertex.xy;
    xy -= vec2(.5, .5);
    xy += t * 0.05 * sign(xy);
    xy += vec2(.5, .5);

    vs.vertex.xy = xy;
}

// this is your custom vertex transform function.
// you can modify the incoming vertex data here as want.
void CustomVertexTransform(inout VertexData vs) {

   // your code here
    float t = sin(kTime + kRandom * 3.0);    

    vs.vertex.x += 0.2 * t * (1.0-vs.vertex.y);

}
